# Criar banco de dados
CREATE DATABASE exercicio_sql;
USE exercicio_sql;

# Criar tabela
CREATE TABLE clientes (
	id INT PRIMARY KEY,
	nome VARCHAR(100),
    sobrenome VARCHAR(100),
	email VARCHAR(100),
    genero VARCHAR(20),
    data_nasc DATE,
    cidade VARCHAR(50),
    estado VARCHAR(50),
    telefone VARCHAR(20),
    renda_mensal DECIMAL(10, 2),
    status_cliente VARCHAR(10)
);

